import React from 'react';
import './imageButton.css';

function ImageButton({imageSrc, alt, width, height}) : any {
  return (
    <button className="ImageBtn">
      <img src={imageSrc} alt={alt} width={width} height={height}/>
    </button>
  );
}

export default ImageButton;
